import POSController from './POSController';
import './App.css';

function App() {
    return (
        <div className="App">
            <h1>Mini POS System - Convenience Store</h1>
            <POSController />

            <section className="categories-section">
                    <h2>Categories</h2>
                    <ul>
                        <li>Drinks</li>
                        <li>Snacks</li>
                        <li>Meals</li>
                        {/* Add more categories as needed */}
                    </ul>
                </section>
        </div>


    );
}

export default App;
